import urllib.request

x = urllib.request.urlopen('https://www.irs.gov/individuals/acceptance-agents-texas')

page = x.read()
page=page.decode()
page=page.replace('\r',' ')
page=page.replace('\n',' ')
page=page.replace('<p>',' ')
page=page.replace('</p>',' ')
page=page.replace('<td>&nbsp;</td>','')
page=page.replace('<br>',' ')
page=page.replace('</br>',' ')
def parsing(page):
    output = {}
    k = page.find('<table border=')
    end = page.find('Return to Index', k)
    name_start = page.find('<td>', k)
    while name_start!=-1:
        name_end = page.find('</td>', name_start)
        address_start = page.find('<td>', name_end)
        name = page[name_start + 4: name_end - 1]
        address_end = page.find('</td>', address_start)
        address = page[address_start + 4:address_end]
        output[name] = address
        name_start = page.find('<td>', address_end, end)

    return output

print (parsing(page))


